uploadtext:
Файла тиеме ҫак формӑпа усӑ курӑр.
Маларах тиенӗ файлсене пӑхма е вӗсене тупма [[Special:FileList|тиенӗ файлсен списокне]] пӑхӑр. Тиенисемпе ҫиелтен тиенисем ҫавӑн пекех [[Special:Log/upload|тиенисен журналӗнче]] ҫырӑнса пыраҫҫӗ. Файлсене кӑларса пени пирки [[Special:Log/delete|кӑларса пенисен журналӗнче]] тупма пулать.

Файла статьяна вырнаҫтармашкӑн, ҫак форматсенчен пӗринпе усӑ курса каҫӑ хатӗрлӗр:
* файлӑн тулли версийӗпе усӑ курмашкӑн: <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.jpg]]</nowiki></code></strong>;
** текстран сулахай енче 200 пиксель сарлакӑшпе вырнастармашкӑн тата ун айӗнче ӑнлантарӑвне хушса: <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.png|200px|thumb|left|Caption]]</nowiki></code></strong>;
* файлӑн шалти информацине кӑтартмасӑр, файлпа туллин усӑ курмашкӑн: <strong><code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:File.ogg]]</nowiki></code></strong>.
